import './App.css';
import Menu from './Menu';
import { useState } from 'react';
import MainContent from './MainContent';
import {Title, Body} from './practica_2/components/Title';

function App() {
  const [practiceSelected, setPracticeSelected] = useState('#practica_1');

  const site = {
    pageTitle: 'Unidad 1.2 - Práctica',
    pageBody: 'Implementación de árbol de componentes y propiedades en React.'
  };

  return (
    <div>
      <Title> title = {site.pageTitle}</Title>
      <Body> {site.pageBody}</Body>
      <Menu onOptionSelected={(t) => { setPracticeSelected(t) }} />
      <MainContent practiceSelected={practiceSelected} />
    </div>
  );
}

export default App;
